var doAjaxRequest = function(options) {
	var dataType = options.dataType || 'text';
	var suc = options.success || emptyFn;
	var error = options.error || emptyFn;
	var xhr = xmlrequest();
	xhr.onreadystatechange = function (){
		if( xhr.readyState === 4){
			status = xhr.status || 0;
			if (status == 200) {
				if(dataType=='text'){
					suc(xhr.responseText,xhr);
					return;
				}
				if(dataType=='json'){
					try{
						var json = $.parseJSON(xhr.responseText);
						suc(json,xhr);
					} catch(e){
						error(xhr.responseText,xhr,",json");
					}
					return;
				}
				if(dataType=='xml'){
					if (xhr.responseXML && xhr.responseXML.documentElement) {
						suc(xhr.responseXML.documentElement,xhr);
					} else {
						error(xhr.responseText,xhr,"ajaxxml");
					}
					return;
				}
				suc(xhr.response || xhr.responseText,xhr);
				return;
			} else {
				if(dataType=='json'){
					try{
						var json = $.parseJSON(xhr.responseText);
						error(json,xhr,"");
					} catch(e){
						error(xhr.responseText,xhr,"");
					}
					return;
				}
				if(dataType=='xml'){
					if (xhr.responseXML && xhr.responseXML.documentElement) {
						error(xhr.responseXML.documentElement,xhr,"");
					} else {
						error(xhr.responseText,xhr,"");
					}
					return;
				}
				error(xhr.responseText,xhr,"");
				return;
			}
		}
		if( xhr.readyState === 0){
			error(xhr.responseText,xhr,"");
		}
	};

	if(options.responseType){
		if("responseType" in xhr){
			xhr.responseType = options.responseType;
		} else {
			error('',xhr,"");
			return null;
		}
	}
	if(options.mimeType){
		if(hasOverrideMimeType){
			xhr.overrideMimeType(options.mimeType);
		} else {
			error('',xhr,"mimeType");
			return null;
		}
	}
	
	var type = options.type || "POST";
	xhr.open(type, options.url);
	
	var headers = options.headers || {};
	for(var key in headers){
		if(hasSetRequestHeader){
			xhr.setRequestHeader(key, headers[key]);
		} else {
			error('',xhr,"header");
			return null;
		}
	}

	var data = options.data || null;
	xhr.send(data);
	return xhr;
};

var getFileUrlFn = function(fileInputId) {
	var uri = {
		url : '',
		filename : '',
		filetype : ''
	};
	if ("URL" in window && "createObjectURL" in window.URL) {
		var fileItems = document.getElementById(fileInputId).files;
		if (fileItems.length > 0) {
			var u = fileItems.item(0);
			uri.url = window.URL.createObjectURL(u);
			uri.filename = u.name || '';
		}
	} else { // IE
		var u = document.getElementById(fileInputId).value;
		uri.url = u;
		var pos1 = u.lastIndexOf('/');
		var pos2 = u.lastIndexOf('\\');
		var pos = Math.max(pos1, pos2)
		if (pos < 0)
			uri.filename = u;
		else
			uri.filename = u.substring(pos + 1);
	}
	var index = uri.filename.lastIndexOf(".");
	if (index != -1) {
		uri.filetype = uri.filename.substring(index+1).toLowerCase();
	}
	return uri;
};
